import React, { Component } from 'react';

import styles from './Levels.module.scss';

export default class Levels extends Component {
    constructor(props){
        super(props);
    }


    render() {

        return (
            <div className={`${styles.levels} ${styles.levels_display}`}>
            </div>
        );
    }
}
